CREATE TABLE mytable(
   ID                VARCHAR(5) NOT NULL PRIMARY KEY
  ,Name              VARCHAR(21) NOT NULL
  ,Blueprint         VARCHAR(24) NOT NULL
  ,Age               NUMERIC(4,1) NOT NULL
  ,Nation            VARCHAR(17) NOT NULL
  ,Club              VARCHAR(16) NOT NULL
  ,Physique          VARCHAR(9) NOT NULL
  ,Character         VARCHAR(13) NOT NULL
  ,"Primary Class"   VARCHAR(11) NOT NULL
  ,"Secondary Class" VARCHAR(11) NOT NULL
  ,Position          VARCHAR(18) NOT NULL
  ,Model             VARCHAR(12) NOT NULL
  ,Level             INTEGER  NOT NULL
  ,Value             VARCHAR(12) NOT NULL
);
